	add("couloir", "{\"term\":\"couloir\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027couloir\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A steep gorge along a mountainside\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Yvon Chouinard, \u0027Climbing Ice\u0027, %22couloirs%22+-intitle:%22couloir|couloirs%22+-inauthor:%22%22\u0026amp;dq\u003d%22couloir%22|%22couloirs%22+-intitle:%22couloir|couloirs%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9GUWT5iUFIXqmAX3xZHPAw\u0026amp;sqi\u003d2\u0026amp;redir_esc\u003dy page 145\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Those deep, dark slots in a mountain known as \u0027\u0027couloirs\u0027\u0027 are often the most obvious routes of ascent\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Roger Marshall, \u0027AdventureSport: Everest and Me\u0027, \u0027w:Backpacker Backpacker\u0027, %22couloirs%22+-intitle:%22couloir|couloirs%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9GUWT5iUFIXqmAX3xZHPAw\u0026amp;sqi\u003d2\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"%22couloirs%22%20-intitle%3A%22couloir|couloirs%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 42\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Looking up the face I could see directly into the Japanese and Hornbein \u0027\u0027couloirs\u0027\u0027, an almost direct 9000 feet to the summit\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, R. J. Secor, \u0027Denali Climbing Guide\u0027, %22couloirs%22+-intitle:%22couloir|couloirs%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9GUWT5iUFIXqmAX3xZHPAw\u0026amp;sqi\u003d2\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"%22couloirs%22%20-intitle%3A%22couloir|couloirs%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 99\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Ascend a long, easy snow \u0027\u0027couloir\u0027\u0027 back left to the crest of Cassin Ridge at 17700 feet, where there is a campsite\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, American Alpine Club Safety Committee, Alpine Club of Canada Safety Committee, \u0027Accidents in North American Mountaineering\u0027, Issue 55, %22couloirs%22+-intitle:%22couloir|couloirs%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9GUWT5iUFIXqmAX3xZHPAw\u0026amp;sqi\u003d2\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22couloirs%22%20-intitle%3A%22couloir|couloirs%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 58\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"When they approached the \u0027\u0027couloir\u0027\u0027 shortly before 0300, the snow was firm enough for them to use crampons\", \"priority\":12}]}, \"synonyms\":{}}");

