	add("coulrophobia", "{\"term\":\"coulrophobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"A neologism, coined in the late 1980s or 1990s. Supposedly based on Ancient greek (to 1453) \u0027κωλοβαθριστής\u0027 (one who goes on stilts) (from \u0027κωλόβαθρον\u0027 (stilt) from \u0027κῶλον\u0027 (limb) + \u0027βαίνω\u0027 (i go) ,chosen for lack of an obvious Ancient Greek equivalent of \u0026quot;clown\u0026quot;, combined with the \u0027-phobia\u0027 (fear of) suffix.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The irrational fear of clowns\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 Condé Nast Traveler 34, p. x\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;!--google books snippet view--\u0026gt; to develop coulrophobia. On the seventh, clowns from around he world [...] congregate at London\u0027s Holy Trinity Church for the annual Grimaldi Memorial Service\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027 Jared Paul Stern, with Paula Froelich and Chris Wilson, \u0026quot;Send out the Clowns\u0026quot;, Page Six (NYT\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Clowns are no laughing matter to Sean \u0026quot;Puffy\u0026quot; Combs. The swaggering rap royal is widely reported to suffer from coulrophobia, an irrational fear of the red-nosed, versized-shoe-wearing, greasepainted circus buffoons\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: Andy Field, Graham Hole, \u0027How to Design and Report Experiments\u0027, p. 25\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;5\u0026lt;/sup\u0026gt;Unfortunately, the first time they attempted the study, the clown accidentally burst one of the balloons. The noise frightened the children and they associated that fear response with the clown. All 15 children are currently in therapy for \u0027\u0027coulrophobia\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Phineas Mollod \u0026amp; Jason Tesauro, \u0027The Modern Lover: A Playbook for Suitors, Spouses \u0026amp; Ringless Carousers\u0027, p3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"After you plug in your wish list and dating criteria, search results spit out matches; it’s like scanning a room of a thousand and pinpointing the ten who share your favorite author and chronic \u0027\u0027coulrophobia\u0027\u0027 (fear of clowns\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Crimson de la Voire, \u0027Crimson’s Erotica: Volume One — A Collection of Stories About Submission and Pleasure\u0027, p3\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The ironic twist is that he recently admitted to a possible onset of \u0027\u0027coulrophobia\", \"priority\":11}]}, \"synonyms\":{\"list\":[{\"text\":\"clownophobia\", \"synonymQualifier\":\"INFORMAL\"}]}}");

