	add("counselor", "{\"term\":\"counselor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027conseillier\u0027 from Latin \u0027consiliator\u0027 (lang\u003dla) agent noun from \u0027consilior\u0027 (lang\u003dla) from \u0027consilium|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A professional who counsels people, especially on personal problems\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A licensed and professionally trained counselor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A school counselor, often in a specialty such as careers, education, or health\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A counselor, counsellor, counselor-at-law or counsellor-at-law is an attorney\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A high ranking diplomat, usually just below an ambassador or minister\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A children’s supervisor, usually at camp\", \"priority\":6}]}, \"synonyms\":{}}");

