	add("countenance", "{\"term\":\"countenance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"Anglo-norman from Latin {{m|la|contineō||hold together}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Appearance, especially the features and expression of the face\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Genesis 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But unto Cain and to his offering he had not respect. And Cain was very wroth, and his \u0027\u0027countenance\u0027\u0027 fell\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dBut Richmond, his grandfather\u0027s darling, after one thoughtful glance cast under his lashes at that uncompromising \u0027\u0027countenance\u0027\u0027 appeared to lose himself in his own reflections\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Favour; support; encouragement\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thou hast made himglad with thy \u0027\u0027countenance\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1663-1732\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"This is the magistrate\u0027s peculiar province, to give \u0027\u0027countenance\u0027\u0027 to piety and virtue, and to rebuke vice\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Superficial appearance; show; pretense\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1515-1568\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The election being done, he made \u0027\u0027countenance\u0027\u0027 of great discontent thereat\", \"priority\":11}]}, \"synonyms\":{}}");

