	add("counterorder", "{\"term\":\"counterorder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|order|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An order (command) made in opposition to a previous one\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterparty", "{\"term\":\"counterparty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|party|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The other party to a financial transaction\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterphobia", "{\"term\":\"counterphobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|phobia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compulsion to seek out the causes of fear or anxiety instead of avoiding them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterpicket", "{\"term\":\"counterpicket\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|picket|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A picket (protest) set up in opposition to another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterplea", "{\"term\":\"counterplea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|plea|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plea made in opposition to another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterplot", "{\"term\":\"counterplot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|counter|plot|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plot made in opposition to another; a counterploy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterposition", "{\"term\":\"counterposition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|position|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opposite or opposing position\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterpower", "{\"term\":\"counterpower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|power|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political power capable of challenging and potentially removing the power of another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Tim Gee, \u0027Counterpower\u0027 (page 17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the hands of the few power can be called oppression, repression, exploitation or authoritarianism. Meanwhile movements for freedom, emancipation, liberation, human rights and democracy have a common idea at their heart. That idea is Counterpower\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Christian Barry, Thomas Winfried Menko Pogge, \u0027Global institutions and responsibilities: achieving global justice\u0027 (page 182\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A fifth step must be taken if the project of empire is to be defeated — namely, the emergence of effective \u0027\u0027counterpowers\u0027\u0027 within the world community, able to balance the superpower of the United States\", \"priority\":5}]}, \"synonyms\":{}}");

	add("counterpressure", "{\"term\":\"counterpressure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|pressure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Pressure applied in one direction to counterbalance pressure from another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterprogramme", "{\"term\":\"counterprogramme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|programme|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A programme that counters or responds to another programme\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterprogramming", "{\"term\":\"counterprogramming\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|programming|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Psychological programming carried out to combat the effects of earlier programming\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterpropaganda", "{\"term\":\"counterpropaganda\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|propaganda|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Propaganda disseminated as a response and opposition to other propaganda\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterproposal", "{\"term\":\"counterproposal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|proposal|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proposal made as an alternative to another, earlier proposal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterproposition", "{\"term\":\"counterproposition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|proposition|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proposal made as an alternative to another, earlier proposition\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterprotest", "{\"term\":\"counterprotest\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|protest|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protest held in opposition to another protest\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterprotester", "{\"term\":\"counterprotester\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|protester|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person engaging in a counterprotes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterpunch", "{\"term\":\"counterpunch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|punch|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A punch delivered in return of a previous punch by somebody else, such as an opponent in a boxing match\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterpuncher", "{\"term\":\"counterpuncher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|counterpunch|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A player who returns every ball and relies on the opponent making mistake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A boxer who commonly counterpunches\", \"priority\":2}]}, \"synonyms\":{}}");

	add("counterquestion", "{\"term\":\"counterquestion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|question|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A question that serves as a reply to, or distraction from, another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterrally", "{\"term\":\"counterrally\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|rally|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rally (demonstration) held in opposition to another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterreform", "{\"term\":\"counterreform\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|reform|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Opposition to reform\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterresistance", "{\"term\":\"counterresistance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|resistance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"resistance to a patient\u0027s influence on his or her therapy by the therapist, such as changing the subject\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterrhythm", "{\"term\":\"counterrhythm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|rhythm|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rhythm that complements another rhythm\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterstain", "{\"term\":\"counterstain\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|stain|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stain contrasting with the principal stain in color, thus making the stained structure easier to see\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterstory", "{\"term\":\"counterstory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|story|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A story that opposes and responds to an existing story\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countersuit", "{\"term\":\"countersuit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|suit|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lawsuit filed against a party that has filed a suit against one\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countersurveillance", "{\"term\":\"countersurveillance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|surveillance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art of evading surveillanc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countertendency", "{\"term\":\"countertendency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|tendency|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A contrary or opposing tendency\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countertenor", "{\"term\":\"countertenor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|tenor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"adult male singer who uses head tone or falsetto to sing far higher than the typical male vocal rang\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"male singing voice far higher than the typical male vocal rang\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d8 August passage\u003dThe term \u0027\u0027countertenor\u0027\u0027 first appeared in England during the mid 17th century. However, the style of singing originated in Elizabethan cathedral choirs, eventually falling out of favour during the Romantic period\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Older)\u0027 a part or section performing a countermelody against the tenor or main part\", \"priority\":4}]}, \"synonyms\":{}}");

	add("countertop", "{\"term\":\"countertop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|counter|top|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The top surface of a counter, for preparation of food etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countervair", "{\"term\":\"countervair\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|vair|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A heraldic fur resembling vair, except in the arrangement of the patches or figures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterviewpoint", "{\"term\":\"counterviewpoint\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|viewpoint|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opposing viewpoint\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterweight", "{\"term\":\"counterweight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|weight|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A heavy mass of often iron or concrete, mechanically linked in opposition to a load which is to be raised and lowered, with the intent of reducing the amount of work which must be done to effect the raising and lowering. Counterweights are used, for example, in cable-hauled elevators and some kinds of movable bridges (e.g. a bascule bridge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("counterword", "{\"term\":\"counterword\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|counter|word|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word (for example \u0027so\u0027) that is frequently used in a reflex-like manner in an answer and that has thereby quickly taken on a new, much less specific or much looser meaning or is even almost meaningless and performs a completely new function\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Such a word (or a word that has gone through a similar change) when not used as a reflex-like answer\", \"priority\":2}]}, \"synonyms\":{}}");

	add("countess", "{\"term\":\"countess\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Anglo-norman \u0027cuntesse\u0027 Old french (842-ca. 1400) \u0027contesse\u0027 from Latin \u0027comitessa\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The wife of a count or earl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The title used by a female who holds an earldom in her own right\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Elizabeth Millicent Leveson-Gower is 24th \u0027\u0027Countess\u0027\u0027 of Sutherland; her son will be the 25th Earl\", \"priority\":3}]}, \"synonyms\":{}}");

	add("countification", "{\"term\":\"countification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|count|ification|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The conversion of a noncountable noun to a countable noun form\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, The Yugoslav Serbo-Croatian-English Contrastive Projec\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With some mass and abstract nouns, \u0027\u0027\u0026quot;countification\u0026quot;\u0027\u0027 is accompanied by a shift of meaning: paper (SC papir) vs. a paper (SC novine, dokument\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, \u0026quot;Marilyn Martin\u0026quot;, \u0027Article question redux\u0027 (on Internet newsgroup \u0027bit.listserv.tesl-l\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The use of A with GRAIN gives the class membership of the item and illustrates the \u0027\u0027\u0026quot;countification\u0026quot;\u0027\u0027 of mass nouns, with the deletion of the understood \u0026quot;type(s) of.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Ben Zimmer, \u0027New York Times\u0027 (24 May 2010\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027countification\u0027\u0027 of e-mail mirrors some other recent developments in tech-talk\", \"priority\":7}]}, \"synonyms\":{}}");

	add("countline", "{\"term\":\"countline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|count|line|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A consumer product (especially confectionery) that is supplied to retailers in packages of multiple items and sold individually to customers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countries", "{\"term\":\"countries\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"passage\u003dBut poverty’s scourge is fiercest below $1.25 (the average of the 15 poorest \u0027\u0027countries’\u0027\u0027 own poverty lines, measured in 2005 dollars and adjusted for differences in purchasing power): people below that level live lives that are poor, nasty, brutish and short\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countryfolk", "{\"term\":\"countryfolk\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|country|folk|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who lives in the country; a rural dweller\", \"priority\":1}]}, \"synonyms\":{}}");

	add("countryside", "{\"term\":\"countryside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|country|side|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"typically used with the definite article\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A rural landscape\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A rural area, or the rural part of a larger area, as in \u0026quot;the Swedish countryside.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("coupler", "{\"term\":\"coupler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|couple|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who couples things together, especially someone whose job it is to couple railway carriages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything that serves to couple things together; but especially a device that couples railway carriages\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A device that connects two keyboards of an organ together so that they play together\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A device used to convert electronic information into audible sound signals for transmission over telephone lines\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An electrical device used to transfer energy from one electric device to another, especially without a physical connection\", \"priority\":5}]}, \"synonyms\":{}}");

	add("couplezilla", "{\"term\":\"couplezilla\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|couple|zilla|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A couple who, in the course of planning their wedding, display difficult, selfish, narcissistic behaviour relating to the event\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;br /\u0026gt;I say.. \u0027\u0027Couplezilla\u0027\u0027 go ahead and embrace your zilla-ness. This is the stuff that makes great wedding horror stories\", \"priority\":2}]}, \"synonyms\":{}}");

	add("courageousness", "{\"term\":\"courageousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|courageous|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being courageous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("courgette", "{\"term\":\"courgette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027courgette\u0027 diminutive of \u0027courge\u0027 (vegetable marrow, marrow squash)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular variety of \u0027Cucurbita pepo\u0027, a small marrow/squash\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The edible fruit of this marrow/squash\", \"priority\":2}]}, \"synonyms\":{}}");

	add("coursebook", "{\"term\":\"coursebook\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|course|book|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A textbook, a book designed to accompany a specific academic course, or one specified by the writers of the course to be read by its students\", \"priority\":1}]}, \"synonyms\":{}}");

	add("coursemate", "{\"term\":\"coursemate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|course|mate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is taking the same academic course\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I went drinking with some of my \u0027\u0027coursemates\u0027\u0027 after the last lecture of the term\", \"priority\":2}]}, \"synonyms\":{}}");

	add("courtesan", "{\"term\":\"courtesan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French {{m|fr|courtisane}}, from Italian {{m|it|cortigiana}}, feminine of {{m|it|cortigiano||courtier}}, from {{m|it|corte||court}}, itself from Latin {{m|la|cohors}}. More at English {{l|en|court}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman of a royal or noble court\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The mistress of a royal or noble\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A prostitute, especially one with high-status or wealthy clients\", \"priority\":3}]}, \"synonyms\":{}}");

	add("courtesy", "{\"term\":\"courtesy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027curtesie\u0027 from Anglo-norman \u0027curtesie\u0027 from Old french (842-ca. 1400) \u0027curteisie\u0027 \u0027cortoisie\u0027 \u0026lt;ref\u0026gt;[http://books.google.ca/books?id\u003daDhGlKL3h00C\u0026amp;pg\u003dPA97\u0026amp;lpg\u003dPA97\u0026amp;dq\u003dcourtesy+etymology\u0026amp;source\u003dbl\u0026amp;ots\u003dt3EKf41eNo\u0026amp;sig\u003dorGVGkmIiBWn0P8mdZvWP8hqse4\u0026amp;hl\u003dit\u0026amp;ei\u003dvrRhTMKQLIO88gao2KGjCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CBAQ6AEwADg. v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse The concise dictionary of English etymology, p. 97]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?term\u003dcourtesy Online Etymology Dictionary]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Polite behavior\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Please extend them the \u0027\u0027courtesy\u0027\u0027 of your presence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A polite gesture or remark\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I offered them a ride simply as a \u0027\u0027courtesy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"My lord, for your many \u0027\u0027courtesies\u0027\u0027 I thank you\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Consent or agreement in spite of fact; indulgence\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"They call this pond a lake by \u0027\u0027courtesy\u0027\u0027 only\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Willingness or generosity in providing something needed\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"They received free advertising through the \u0027\u0027courtesy\u0027\u0027 of the local newspaper\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A curtsey\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Goldsmit\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The lady drops a \u0027\u0027courtesy\u0027\u0027 in token of obedience, and the ceremony proceeds as usual\", \"priority\":13}]}, \"synonyms\":{}}");

